import React from 'react';
import './Login.css';
import { Button, Form, FormGroup, Label, Input } from 'react-bootstrap';


const Login = (props) => {
    return (
        <Form className='loginForm'>
            <h1>
                <span className='font-weight-bold'>TEAMUP</span>.com
            </h1>
        </Form>
    )
}

export default Login;
